大理石的强度与其成分、结晶状态有关,一般来说碳酸盐类和大理岩类的强度较高,变质类和石灰岩类的强度较低。具体来说:

- 碳酸盐类大理石如白云石、石灰华等其抗压强度约为70兆帕左右;

- 大理岩类大理石如云南红、中国黑等其抗压强度约为100兆帕左右;

- 变质类大理石如杜陵、砂金石等其抗压强度约为30兆帕左右;

- 石英类大理石如苍山红、珍珠白等其抗压强度约为50兆帕左右。

需要注意的是,上述数据仅供参考,实际情况可能会受到环境因素影响而有所变化。

