五中做法如下：
一、蒜泥凉拌黄瓜

材料:黄瓜2根,大蒜3瓣,盐1小勺,醋1/2大勺。

步骤:
1. 将黄瓜洗净切成薄片;
2. 放入碗中加少许盐和醋腌制15分钟以上;
3. 大蒜剥皮捣成蒜泥备用;
4. 将腌好的黄瓜用清水冲洗一遍后挤干水分;
5. 放进一个大点的容器里,加入蒜泥和所有调料拌匀即可食用。

二、红油凉拌黄瓜

材料:黄瓜2根,辣椒酱30克,生抽5毫升,香醋10毫升,白糖8克,芝麻油适量,食盐2克。

步骤:
1. 黄瓜洗净切去两端,用模具刻出形状;
2. 锅中倒入适量的水烧开,下入黄瓜焯烫约2-3分钟后捞出放冷水中投凉;
3. 取一只干净的碗,将所有的调味料(除芝麻油外)混合在一起搅拌均匀;
4. 把调味汁淋在黄瓜上,再撒上熟白芝麻即可。

三、蓑衣黄瓜

材料:黄瓜2根,胡萝卜半根,花椒粉少量,酱油5毫升,陈醋7毫升,糖4克,鸡精少量,香油数滴。

步骤:
1. 胡萝卜去皮切片,黄瓜洗净斜着切成片;
2. 热锅加油,六成热时爆香花椒粉;
3. 加入胡萝卜翻炒1-2分钟至变软;
4. 下入黄瓜继续煸炒1-2分钟;
5. 最后加入酱油、陈醋、糖、鸡精和水淀粉勾兑的欠汁煮开即可出锅。

四、酸辣黄瓜丝

材料:黄瓜2根,泡椒6个,小米椒2个,葱1棵,姜1小块,蒜2头,香菜适量,食用油适量,酱油5毫升,醋10毫升,糖4克,鸡粉少量,胡椒粉微量。

步骤:
1. 泡椒切碎,葱姜蒜切末,香菜切段备用;
2. 黄瓜洗净刨成细丝放进碗里,加入适量的盐抓匀腌制20分钟左右;
3.锅里倒足量的油烧热,下入葱姜蒜末和泡椒爆出香味;
4. 加入酱油、醋、糖、鸡粉和少量的胡椒粉,搅拌一下关火;
5.把料汁倒在黄瓜丝上拌匀,最后撒上香菜段就可以了。

