- 上海 - 经济较为发达,公共设施完善,文化氛围浓厚,居民素质较高;
- 广州 - 自然环境优越,气候宜人,社会秩序良好,经济发展迅速;
- 深圳 - 城市规划合理,人口密度低,交通便利,创新创业活跃;
- 成都 - 生活节奏较慢,自然环境优良,人文气息浓郁,消费水平较低;
