数学家选择高是为了使得这个和函数更加准确。具体来说:

1. 减小高可以使和函数的值域更广;
2. 高也可以限制误差的范围,使其不会变得过大而导致结果不准确;
3. 如果高的取值过于保守(比如等于或非常接近于1),那么可能会导致一些特殊形状的曲线无法被该和函数近似描述。

因此,数学家用一个合适的数值作为高来保证结果的精度和质量。综上所述,数学家在选取高的时候并不是完全不考虑误差的累积效应,而是通过合理的设计和控制来达到既定目标。

