坐骑系统是很多游戏都非常重视的一个元素,比如《魔兽世界》、《暗黑破坏神》等。而原神作为一款开放世界动作角色扮演手游,并没有推出坐骑系统的计划。原因可能有以下几点:

1. 游戏玩法较为复杂和多样化,不需要额外的道具或资源来获取坐骑;
2. 玩家对坐骑的需求并不强烈或者游戏中已经提供了一些其他的移动方式(如步行、飞行);
3. 成本问题,开发制作一个完整的坐骑系统需要大量的时间和成本投入。

因此,暂时不推出坐骑系统也是一个比较合理的选择。不过未来如果玩家需求量较大或者有其他因素的影响下可能会考虑增加该要素。

