1. 植保无人机:用于喷洒农药、除草等作业的无人机;
2. 物流无人机:主要用于快递和物流配送等领域;
3. 航拍无人机:可以进行空中拍摄和视频传输等工作;
4. 监视安防无人机:可用于安全监控和环境监测等方面;
5. 军用无人机:主要应用于军事领域,如情报收集、打击敌人等任务。

除此之外,还有一些其他特殊用途的无人机,例如渔业无人机、气象无人机等等。

